module.exports = assignmentParser;

var parser = require('Parser');

function assignmentParser(p){
    var data = {};
    p.getLine();
    p.getLine();
    p.getLine();
    var numStudents = p.getSecondPart();
    for(i=0; i<numStudents;i++){
        var email = p.getLine();
        var time = p.getLine();
        p.getLine();
        if(typeof data[time] === 'undefined'){
            data[time] = [];
            data[time].push(email);
        }else{
            data[time].push(email);
        }
    }
    return data;
}